import React , { createContext } from 'react';

const Authcontext = createContext();

const state = {
    login: () => { },
    logout: () => { },
    auth: { email: '', password: ''}
}

const AuthContextComponent = (props) => {

    return (
        <Authcontext.Provider value = { state } >
            {props.children}
        </Authcontext.Provider>
    )
}

export default Authcontext
